import * as React from 'react';
import logo from './paypal-logo.jpeg';
import './App.css';
import { Button, TextField } from '@mui/material';
import { alpha, styled } from '@mui/material/styles';
import InputBase from '@mui/material/InputBase';
import Box from '@mui/material/Box';
import InputLabel from '@mui/material/InputLabel';
import { TextFieldProps } from '@mui/material/TextField';
import FormControl from '@mui/material/FormControl';
import { OutlinedInputProps } from '@mui/material/OutlinedInput';

// const RedditTextField = styled((props: TextFieldProps) => (
//   <TextField
//     InputProps={{ disableUnderline: true } as Partial<OutlinedInputProps>}
//     {...props}
//   />
// ))(({ theme }) => ({
//   '& .MuiFilledInput-root': {
//     overflow: 'hidden',
//     borderRadius: 4,
//     backgroundColor: theme.palette.mode === 'light' ? '#F3F6F9' : '#1A2027',
//     border: '1px solid',
//     borderColor: theme.palette.mode === 'light' ? '#E0E3E7' : '#2D3843',
//     transition: theme.transitions.create([
//       'border-color',
//       'background-color',
//       'box-shadow',
//     ]),
//     '&:hover': {
//       backgroundColor: 'transparent',
//     },
//     '&.Mui-focused': {
//       backgroundColor: 'transparent',
//       boxShadow: `${alpha(theme.palette.primary.main, 0.25)} 0 0 0 2px`,
//       borderColor: theme.palette.primary.main,
//     },
//   },
// }));


function App() {
  return (
    <div id="App">
      <div style={{width: '460px', margin: '0 auto'}}>
        <div id="login-section" style={{
          margin: '120px auto 0px',
          border: '1px solid #eaeced',
          borderRadius: '12px',
          overflow: 'hidden',
          padding: '30px 10% 50px',
          }}>
          <header style={{margin: '0 auto 13.116%', display: 'flex',
          justifyContent: 'center'}}>
            <p style={{background: 'transparent url(https://www.paypalobjects.com/paypal-ui/logos/svg/paypal-mark-color.svg) top center no-repeat',
            width: '34px', height: '40px', margin: '0px'}}></p>
          </header>
          <div id="login-form" style={{padding: 'auto'}} >
            {/* <div className="input">
              <input id="email" required="required" placeholder="Email or mobile number"/>
                <label for="email">Email or phone number</label>
            </div> */}
            <TextField
              id="username"
              label="Email or mobile number"
              variant="filled"
              margin="dense"
              fullWidth
              InputProps={{disableUnderline: true}}
              sx={{
                '& label.Mui-focused': {
                  color: '#6c7378',
                },
                '& .MuiFilledInput-root': {
                  overflow: 'hidden',
                  border: 1,
                  borderRadius: '4px',
                  marginBottom: '16px',
                  borderColor: '#9da3a6',
                  backgroundColor: 'transparent',
                  fontWeight: 600,
                  fontHeight: '18px',
                  '&:hover': {
                    borderColor: '#2140C1'
                  },
                  '&.Mui-focused': {
                    backgroundColor: 'transparent',
                    border: 3,
                    borderRadius: '4px',
                    borderColor: '#2140C1',
                    boxShadow: '0px 0px 0px 6px #DFEAFC'
                  }
                }
              }}
            />
            <TextField
              id="password"
              label="Password"
              variant="filled"
              type="password"
              margin="dense"
              fullWidth
              InputProps={{disableUnderline: true}}
              sx={{
                '& label.Mui-focused': {
                  color: '#6c7378',
                },
                '& .MuiFilledInput-root': {
                  overflow: 'hidden',
                  border: 1,
                  borderRadius: '4px',
                  marginBottom: '16px',
                  borderColor: '#9da3a6',
                  backgroundColor: 'transparent',
                  // color: '#6c7378',
                  '&:hover': {
                    borderColor: '#2140C1'
                  },
                  '&.Mui-focused': {
                    color: '#000',
                    fontWeight: 800,
                    fontHeight: 18,
                    backgroundColor: 'transparent',
                    border: 3,
                    borderRadius: '4px',
                    borderColor: '#2140C1',
                    boxShadow: '0px 0px 0px 6px #DFEAFC'
                  }
                }
              }}
            />
            <div id="forgot-password">
              <a id="forgot-password-link" href="https://www.paypal.com/authflow/password-recovery/">Forgotten password?</a>
            </div>
            <button id="button-login" type="submit">
              Log In
            </button>
            <div id="separator" style={{
              borderTop: '1px solid #cbd2d6',
              marginTop: '8.72%',
              marginBottom: '4.895%',
              height: '15px',
              textAlign: 'center',
              fontSize: '83.34%',
            }}>
              <span style={{
                backgroundColor: '#fff',
                padding: '0 0.5em',
                color: '#6c7378',
                top: '-0.7em',
                position: 'relative'
              }}>or</span>
            </div>
            <button id="button-sign-up" onClick={() => {window.location.href='https://www.paypal.com/au/webapps/mpp/account-selection'}}>Sign Up</button>
          </div>
          <div style={{
              position: 'relative',
              display: 'block',
              fontSize: '12px',
              marginTop: '72px',
          }}>
          </div>
        </div>
      </div>
      <footer style={{paddingTop: '14px', bottom: 0, position: 'relative'}}>
          <div class="legalFooter" style={{textAlign: 'center', padding: '14px', backgroundColor: '#F7F9FA'}}>
            <ul class="footerGroup" style={{listStyleType: 'none', textAlign: 'center', margin: 0, padding: 0}}>
              <li><a target="_blank" href="https://www.paypal.com/au/smarthelp/contact-us" pa-marked="1">Help &amp; Contact</a></li>
              <li><a target="_blank" href="https://www.paypal.com/au/webapps/mpp/ua/privacy-full" pa-marked="1">Privacy</a></li>
              <li><a target="_blank" href="https://www.paypal.com/au/webapps/mpp/ua/legalhub-full" pa-marked="1">Legal</a></li>
              <li><a target="_blank" href="https://www.paypal.com/au/webapps/mpp/country-worldwide" pa-marked="1">Worldwide</a></li>
            </ul>
          </div>
        </footer>
    </div>
  );
}

export default App;
